function ProductItem({ product }) {
  console.log(product);

  return (
    <li className="productItem">
      <img src={product.imgae} alt={product.title} />
      <p>{product.title}</p>
      <p>{product.price}</p>
      <p>{product.category}</p>
      {/* <p>{product.description}</p> */}
    </li>
  );
}

export default ProductItem;
